import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { itemsAPI, verificationAPI } from '../services/api';

const Dashboard = ({ user }) => {
  const [stats, setStats] = useState({
    foundItems: 1,
    lostItems: 2,
    matches: 3
  });
  const [recentItems, setRecentItems] = useState({
    found: [],
    lost: []
  });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      const [foundResponse, lostResponse, matchesResponse] = await Promise.all([
        itemsAPI.getFoundItems().catch(err => ({ data: { items: [] } })),
        itemsAPI.getLostItems().catch(err => ({ data: { items: [] } })),
        verificationAPI.getMatches().catch(err => ({ data: { matches: [] } }))
      ]);

      setStats({
        foundItems: foundResponse.data.items?.length || 1,
        lostItems: lostResponse.data.items?.length || 2,
        matches: matchesResponse.data.matches?.length || 3
      });

      setRecentItems({
        found: foundResponse.data.items?.slice(0, 3) || [],
        lost: lostResponse.data.items?.slice(0, 3) || []
      });
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    }
  };

  if (loading) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <div>Loading dashboard...</div>
      </div>
    );
  }

  return (
    <div style={{width: '100%', minHeight: '100vh', position: 'relative', background: 'white', overflow: 'auto', transform: 'scale(0.8)', transformOrigin: 'top left'}}>
      <div style={{width: 326, height: 700, left: 0, top: 0, position: 'absolute', background: '#EBF5FD'}} />
      <div style={{width: 400, height: 33, left: 350, top: 120, position: 'absolute', opacity: 0.60, boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 10, border: '1px black solid'}} />
      <div style={{width: 28.61, height: 28.61, left: 365, top: 122, position: 'absolute', overflow: 'hidden', borderRadius: 10}}>
          <div style={{width: 15.90, height: 15.90, left: 3.58, top: 3.58, position: 'absolute', background: 'rgba(0, 0, 0, 0.16)'}} />
          <div style={{width: 17.88, height: 17.88, left: 3.58, top: 3.58, position: 'absolute', outline: '1.50px rgba(0, 0, 0, 0.80) solid', outlineOffset: '-0.75px'}} />
      </div>
      <div style={{width: 122.22, left: 400, top: 128, position: 'absolute', color: 'rgba(0, 0, 0, 0.80)', fontSize: 13, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Search here</div>
      <div style={{width: 111, height: 30, left: 800, top: 120, position: 'absolute', borderRadius: 6, border: '2px black solid'}} />
      <div style={{width: 52, height: 20.45, left: 830, top: 128, position: 'absolute', color: 'black', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Calendar</div>
      <div style={{width: 285, height: 54, left: 20, top: 157, position: 'absolute', background: 'white', boxShadow: '0px 4px 4px 6px rgba(0, 0, 0, 0.25)', borderRadius: 15}} />
      <div style={{left: 96, top: 172, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>Dashboard</div>

      <Link to="/found-item" style={{textDecoration: 'none'}}>
        <div style={{left: 86, top: 252, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}}>Report Found</div>
      </Link>

      <Link to="/lost-item" style={{textDecoration: 'none'}}>
        <div style={{left: 86, top: 317, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}}>Report Lost</div>
      </Link>

      <Link to="/matches" style={{textDecoration: 'none'}}>
        <div style={{left: 83, top: 382, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}}>My Matches</div>
      </Link>

      <div style={{width: 473, left: 350, top: 20, position: 'absolute', color: 'black', fontSize: 28, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Welcome Back {user?.name || 'User'} üëã</div>
      <div style={{left: 350, top: 60, position: 'absolute', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Manage your lost and found items from your dashboard</div>
      <div style={{width: 151, height: 30, left: 760, top: 120, position: 'absolute', background: '#EBF5FD', borderRadius: 10, border: '1px black solid'}} />
      <div style={{width: 80, height: 30, left: 760, top: 120, position: 'absolute', background: 'white', borderTopLeftRadius: 10, borderTopRightRadius: 12, borderBottomRightRadius: 12, borderBottomLeftRadius: 10, border: '1px black solid'}} />
      <div style={{left: 777, top: 125, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Weekly</div>
      <div style={{left: 825, top: 125, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Daily</div>
      <div style={{width: 70.27, height: 70.27, left: 5.75, top: 21.43, position: 'absolute', background: 'white', borderRadius: 9999}} />
      <img style={{width: 84, height: 75.38, left: 0, top: 16, position: 'absolute'}} src="https://placehold.co/84x75" />
      <div style={{left: 111, top: 36, position: 'absolute', color: '#03045E', fontSize: 35, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Back2U</div>

      <Link to="/profile" style={{textDecoration: 'none'}}>
        <div style={{left: 78, top: 626, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}}>Settings</div>
        <img style={{width: 40, height: 40, left: 22, top: 614, position: 'absolute'}} src="https://placehold.co/40x40" />
      </Link>

      <div style={{width: 25, height: 25, left: 292, top: 22, position: 'absolute'}}>
          <div style={{width: 18.75, height: 18.75, left: 3.12, top: 3.12, position: 'absolute', background: 'black'}} />
      </div>
      <div style={{left: 83, top: 678, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>Help</div>
      <img style={{width: 40, height: 40, left: 25, top: 667, position: 'absolute'}} src="https://placehold.co/40x40" />
      <div style={{width: 1279, height: 0, left: 325, top: 111, position: 'absolute', boxShadow: '4px 4px 4px ', outline: '2px rgba(0, 0, 0, 0.50) solid', outlineOffset: '-1px', filter: 'blur(2px)'}} />
      <div style={{width: 650, height: 150, left: 350, top: 170, position: 'absolute', background: 'rgba(0, 119, 182, 0.50)', borderRadius: 20}} />
      <div style={{width: 150.77, left: 370, top: 180, position: 'absolute', color: '#03045E', fontSize: 18, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Your Statistics</div>
      <div style={{width: 140, height: 80, left: 380, top: 210, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
      <div style={{width: 13.42, left: 440, top: 250, position: 'absolute', color: 'black', fontSize: 20, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>{stats.foundItems}</div>
      <div style={{width: 100.17, left: 390, top: 220, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>Item Found</div>
      <div style={{width: 140, height: 80, left: 540, top: 210, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
      <div style={{width: 16.52, left: 600, top: 250, position: 'absolute', color: 'black', fontSize: 20, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>{stats.lostItems}</div>
      <div style={{width: 83.65, left: 560, top: 220, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>Item Lost</div>
      <div style={{width: 140, height: 80, left: 700, top: 210, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
      <div style={{width: 17.93, left: 760, top: 250, position: 'absolute', color: 'black', fontSize: 20, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>{stats.matches}</div>
      <div style={{width: 120, left: 710, top: 220, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '600', wordWrap: 'break-word'}}>Potential Matches</div>

      <Link to="/found-item" style={{textDecoration: 'none'}}>
        <div style={{width: 180, height: 120, left: 350, top: 350, position: 'absolute', background: '#C7F7D2', boxShadow: '4px 4px 4px ', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
        <div style={{width: 160, left: 360, top: 420, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 12, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Found something?<br/> Help someone get their item back!</div>
        <div style={{left: 360, top: 365, position: 'absolute'}}><span style={{color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>üì± </span><span style={{color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Report Found Item</span></div>
      </Link>

      <Link to="/lost-item" style={{textDecoration: 'none'}}>
        <div style={{width: 180, height: 120, left: 550, top: 350, position: 'absolute', background: '#C7EFF7', boxShadow: '4px 4px 4px ', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
        <div style={{width: 160, left: 560, top: 420, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 12, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Lost something? <br/>Let others know what you're looking for!</div>
        <div style={{left: 560, top: 365, position: 'absolute'}}><span style={{color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>üîç</span><span style={{color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}> Report Lost Item</span></div>
      </Link>

      <Link to="/matches" style={{textDecoration: 'none'}}>
        <div style={{width: 180, height: 120, left: 750, top: 350, position: 'absolute', background: 'rgba(0, 0, 0, 0.43)', boxShadow: '4px 4px 4px ', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
        <div style={{width: 160, left: 760, top: 420, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 12, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>Check potential matches and verify ownership</div>
        <div style={{left: 760, top: 365, position: 'absolute'}}><span style={{color: 'white', fontSize: 14, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>üéØ </span><span style={{color: 'white', fontSize: 14, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>View Matches</span></div>
      </Link>

      {/* Recent Found Items */}
      <div style={{width: 280, height: 150, left: 950, top: 120, position: 'absolute', borderRadius: 20, border: '1px black solid', background: 'white'}} />
      <div style={{left: 970, top: 135, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Recent Found Items</div>

      {recentItems.found.length > 0 ? (
        recentItems.found.map((item, index) => (
          <div key={item.id || index} style={{left: 960, top: 155 + (index * 30), position: 'absolute', width: 250}}>
            <div style={{fontSize: 12, fontWeight: '600', color: '#333', marginBottom: 2}}>{item.item_name || 'Unknown Item'}</div>
            <div style={{fontSize: 10, color: '#666'}}>{item.category || 'Category'} ‚Ä¢ {item.location || 'Location'}</div>
          </div>
        ))
      ) : (
        <div style={{left: 970, top: 170, position: 'absolute', fontSize: 11, color: '#999'}}>No found items yet</div>
      )}

      {/* Recent Lost Items */}
      <div style={{width: 280, height: 150, left: 950, top: 290, position: 'absolute', borderRadius: 20, border: '1px black solid', background: 'white'}} />
      <div style={{left: 970, top: 305, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '800', wordWrap: 'break-word'}}>Recent Lost Items</div>

      {recentItems.lost.length > 0 ? (
        recentItems.lost.map((item, index) => (
          <div key={item.id || index} style={{left: 960, top: 325 + (index * 30), position: 'absolute', width: 250}}>
            <div style={{fontSize: 12, fontWeight: '600', color: '#333', marginBottom: 2}}>{item.item_name || 'Unknown Item'}</div>
            <div style={{fontSize: 10, color: '#666'}}>{item.category || 'Category'} ‚Ä¢ {item.location || 'Location'}</div>
          </div>
        ))
      ) : (
        <div style={{left: 970, top: 340, position: 'absolute', fontSize: 11, color: '#999'}}>No lost items yet</div>
      )}

      <div style={{left: 73, top: 550, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}} onClick={() => window.location.href = '/login'}>Log Out</div>
      <img style={{width: 40, height: 40, left: 23, top: 540, position: 'absolute'}} src="https://placehold.co/40x40" />
    </div>
  );
};

export default Dashboard;
